int complex_function(int value, int i)
{
#define LAMBDA 5
  if (!('A' <= value && value <= 'Z'))
  {
    printf("Try again.\n");
    exit(1);
  }
  return ((value - 'A' + (LAMBDA * i)) % ('Z' - 'A' + 1)) + 'A';
}

void avoid_me()
{
  should_succeed = 0;
}

void maybe_good(char *compare0, char *compare1)
{
  if (should_succeed && !strncmp(compare0, compare1, 8))
  {
    printf("Good Job.\n");
  }
  else
  {
    printf("Try again.\n");
  }
}

